import 'bootstrap/dist/css/bootstrap.min.css';
import Logo from '../image/Navlogo.png';
import '../css/navbar.css';

export default function Navbar() {
    return (
        <div>
            <a class="navbar-brand" href="#"><img src={Logo} style={{width:50}}/></a>

            <nav class="navbar navbar-fixed-top navbar-default navbar-nav navbar-right">
                    <ul>
                    <li><a class="nav-link" href="#" >HOME </a></li>
                    <li><a class="nav-link" href="#">STORY </a></li>
                    <li><a class="nav-link" href="#">FOOD </a></li>
                    <li><a class="nav-link" href="#">MEMBER </a></li>
                    </ul>
            </nav>
        </div>
    )
}
{/* <span class="sr-only">(current)</span> */}
